import React, { Component } from 'react';

class Api extends Component {
  constructor() {
    super();
    this.state = {
      users: async () => {
        await fetch('https://jsonplaceholder.typicode.com/users');
      },
    };
    console.log(this.state.users());
  }

  render() {
    this.setState({ users: (response) => response.json() });
    return <div>deva</div>;
  }
}

export default Api;
